import React, { Component } from 'react';
import Navbar from '../components/Navbar/Navbar';
import Footer from '../components/Footer/Footer.js';


export class Home extends Component {
	render() {
		return(
		<React.Fragment>
			<Navbar/>
			<div>Home</div>
			<Footer/>
		</React.Fragment>

		);
	}
}

export default Home;
